import React from "react";
import { Link } from "react-router-dom";
import CryptoMap from "../components/CryptoMap";
import Banner3DSlider from "../components/Banner3DSlider";

const Home = () => {
  const carouselImages = [
    // Show the full logo (no cropping)
    { src: "/images/trendai_logo.png", fit: "contain", bg: "transparent" },

    // The rest can be videos or images; default is cover
    "/videos/luna.mp4",
    "/videos/generated_5.mp4",
    "/videos/robot.mp4",
    "/videos/fight.mp4",
    "/videos/generated_2.mp4",
    "/videos/animation.mp4",
    "/videos/generated_1.mp4",
    "/videos/hello.mp4",
    "/videos/dione.mp4",
    "/videos/generated_3.mp4",
  ];

  return (
    <div className="text-white min-h-screen bg-gradient-to-b from-sky-300/20 via-blue-900/30 to-[#0a0a0a]">
      <Banner3DSlider
        images={carouselImages}
        title=""
        subtitle=""
        authorTitle=""
        authorRole=""
        authorText=""
        modelImage={null}
      />

      {/* ...keep the rest of your sections (Hero, How it works, Use cases, etc.) ... */}
      <section className="relative z-10 max-w-6xl mx-auto px-6 pb-24">
        <CryptoMap />
      </section>
    </div>
  );
};

export default Home;
